import React, { useState } from "react";

interface ButtonProps {
  onClick?: () => void;
  label: string;
}



const Button: React.FC<{ onClick: () => void; label: string }> = (props) =>{
    const [count, setCount] = useState<number>();
    return <div>
        <button onClick={() => {
            setCount(15);
        }}>{props.label}</button>
        <h3>Clicked {count} times</h3>
    </div>
}

export default Button;
